import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // The page uses JavaScript to render products, so we wait for them.
    await page.waitForSelector('div.product-card button.add-to-cart', { timeout: 5000 });

    // Get initial cart state
    const initialCartText = await page.locator('div.cart').textContent();

    // Rapidly add 3 different items to the cart
    const addToCartButtons = page.locator('div.product-card button.add-to-cart');
    await addToCartButtons.nth(0).click();
    await addToCartButtons.nth(1).click();
    await addToCartButtons.nth(2).click();

    // Wait for the cart counter text to update
    await page.waitForFunction(
      (initialText) => document.querySelector('div.cart').textContent.trim() !== initialText.trim(),
      initialCartText,
      { timeout: 5000 }
    );

    const cartTextAfterAdd = await page.locator('div.cart').textContent();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_items_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_items_added.png'));

    // Open the cart to view items
    await page.locator('div.cart').click();
    await page.waitForSelector('.cart-item', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal_open.png'));

    // Remove one item from the cart
    await page.locator('button.remove-item').first().click();

    // Wait for the cart counter text to update again
    await page.waitForFunction(
      (currentText) => document.querySelector('div.cart').textContent.trim() !== currentText.trim(),
      cartTextAfterAdd,
      { timeout: 5000 }
    );

    const cartTextAfterRemove = await page.locator('div.cart').textContent();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_item_removed.png'));

    return {
      success: true,
      action: "Rapidly added 3 items to the cart, opened the cart modal, and removed 1 item.",
      extractedData: {
        initialCartState: initialCartText.trim(),
        cartStateAfterAdding: cartTextAfterAdd.trim(),
        cartStateAfterRemoving: cartTextAfterRemove.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete rapid cart manipulation stress test",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
